import './App.css';
import Navbar from './Components/Navbar';
import Home from './pages/Home';
import{BrowserRouter as Router,Route,Routes} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Router>

        <Routes>
          <Route exact path="/home"  element={Home}></Route>
        </Routes>
      </Router>

    </div>
  );
}

export default App;
